import React, { useState } from "react";
import Purchase from "../assets/icon/purchase.svg";
import Register from "../assets/icon/register.svg";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import '../css/productIcon.css';

const ProductIcon = () => {
  const navigate = useNavigate(); // 추가

  const handlePurchaseClick = () => {
    navigate("/product-registration"); // 이동 경로 수정
  };

  return (
    <footer className="picon">
      <Link to='/ProductRegistration'>
        <li onClick={handlePurchaseClick} style={{ marginLeft: '23px' }}>
          <img className=" w-12 h-12" src={Purchase} alt="purchase" />
          <strong>등록</strong>
        </li>
      </Link>
      <li style={{ marginLeft: '23px' }}>
        <img className=" w-12 h-12" src={Register} alt="register" />
        <strong>등록</strong>
      </li>
    </footer >
  );
}

export default ProductIcon;
